DROP TABLE IF EXISTS `cp_user`;
CREATE TABLE `cp_user` (
  `uid` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(55) NOT NULL DEFAULT '',
  `password` varchar(32) NOT NULL DEFAULT '',
  `agent` varchar(55) DEFAULT NULL,
  `sex` tinyint(1) NOT NULL COMMENT '0保密1男，2女',
  `birthday` datetime DEFAULT NULL COMMENT '生日',
  `phone` varchar(20) NOT NULL COMMENT '电话',
  `qq` varchar(20) NOT NULL COMMENT 'QQ',
  `email` varchar(255) NOT NULL COMMENT '邮箱',
  `paypwd` varchar(20) DEFAULT NULL,
  `totalmoney` float(10,2) DEFAULT NULL,
  `freezemoney` float(10,2) DEFAULT NULL,
  `bankusername` varchar(40) DEFAULT NULL,
  `bankaccount` varchar(30) DEFAULT NULL,
  `bankname` varchar(55) DEFAULT NULL,
  `branchname` varchar(55) DEFAULT NULL,
  `headPhoto` varchar(255) NOT NULL DEFAULT '' COMMENT '头像',
  `regtime` datetime DEFAULT NULL COMMENT '注册时间',
  `lastLoginTime` datetime NOT NULL,
  `botactive` tinyint(1) DEFAULT NULL,
  `percentage` float(6,2) DEFAULT NULL,
  `botpwd` varchar(255) DEFAULT NULL,
  `botonline` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

